For those of you from the JavaScript world, it may be more familiar to use camelCase for variable names instead of snake_case Hasura uses by default. DipDup now allows to convert all fields in metadata to this casing: hasura: camel_case: true Now this example query to hic et nunc demo indexer... query MyQuery { hic_et_nunc_token(limit: 1) { id creator_id }
} ...will become this one: query MyQuery { hicEtNuncToken(limit: 1) { id creatorId }
} All fields auto generated by Hasura will be renamed accordingly: hic_et_nunc_token_by_pk to hicEtNuncTokenByPk, delete_hic_et_nunc_token to deleteHicEtNuncToken and so on. To return to defaults, set camel_case to False and run hasura configure --force. Keep in mind that "camelcasing" is a separate stage performed after all tables are registered. So during configuration, you can observe fields in snake_case for several seconds even if hasura.camel_case flag is set. 🤓 SEE ALSO 11.6. hasura 10. Command-line reference → hasura-configure

